import React from 'react';
import {Link} from 'react-router-dom';
import '../css/login.css'

function Login () {
    return (
        <div className="loginContainer">
            <form className="loginForm">
                <header id="loginHeader">Sign IN</header>
                <input className="loginField" type="text" placeholder=" email" />
                <input className="loginField" type="text" placeholder=" password" />
                <input className="loginButton" type="submit" value="login" />
                <label className="loginSignup">Don't have an account? <span>Sign up now</span></label>
            </form>     
        </div>
    );
}

export default Login;
